import { Component } from '@angular/core';

@Component({
  selector: 'app-movie-list',
  templateUrl: './movie-list.component.html',
  styleUrls: ['./movie-list.component.css']
})
export class MovieListComponent {

  Movie: Array<any> = [
    
    {
    "Id": "1",
    "Name":"Leo",
    "Genre":"Action/Thriller",
    "Type":"movie",
    "Price":"250"

    },

    {
      "Id": "2",
      "Name":"Marvels",
      "Genre":"Action",
      "Type":"movie",
      "Price":"300"
  
    },
    {
        "Id": "3",
        "Name":"Mad",
        "Genre":"Comedy/Drama",
        "Type":"movie",
        "Price":"250"
    
    },
    {
          "Id": "4",
          "Name":"Kalki",
          "Genre":"Sci-fi",
          "Type":"movie",
          "Price":"250"
      
    },
    {
            "Id": "5",
            "Name":"OMG 2",
            "Genre":"Sci-fi",
            "Type":"movie",
            "Price":"250"
        
    },
    {
      "Id": "6",
      "Name":"Spyderman",
      "Genre":"Action",
      "Type":"movie",
      "Price":"300"
  
    }
  
  
  ]

}
<div class="row">
    <div *ngFor="let item of Movie" class="col-sm-4 p-3">
        <app-movie-card [movie_details]="item"></app-movie-card>
    </div>
</div>
